import React from "react";
import ReactFlow from "reactflow";

export default function NodalGraph({ nodes = [], edges = [] }) {
    // Convert companies to React Flow nodes
    const flowNodes = nodes.map((company, index) => ({
        id: company.id || String(index),
        data: { label: company.name || company.email },
        position: { x: 100 * index, y: 50 },
    }));

    // edges are optional for now
    const flowEdges = edges;

    return (
        <div className="mt-6" style={{ width: "100%", height: "400px" }}>
            <ReactFlow nodes={flowNodes} edges={flowEdges} fitView />
        </div>
    );
}
